package takeuchi;

public class sosuu {

	public static void main(String[] args) {
		int[] num = new int[101];
		int i,j;

		num[0] = 1;
		num[1] = 1;
		for(i=2;i<num.length;i++) {
			for(j=2;i*j<num.length;j++) {
				num[i*j] = 1;
			}
		}

		for(i=0;i<num.length;i++) {
			if(num[i] == 0) {
				System.out.print(i + " ");
			}
		}
	}

}

