		}
	}
}

public class primeNumber {
	public static void main(String[] args) {
		for (int i = 2; i < 101; i++) {
			if (primeChecker(i) == true) {
				System.out.print(i + " ");
			}
		}
	}

	static boolean primeChecker(int i) {
		for (int j = 2; j < 51; j++) {
			if (i % j == 0 && i != j) {
				return false;
			}
		}
		return true;
	}
}
